import React, { useEffect, useState } from "react";
import "./DoctorList.css";

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);
  const [fullName, setFullName] = useState("");
  const token = localStorage.getItem("token");

  useEffect(() => {
    // Get and parse patient profile
    const profile = localStorage.getItem("patientProfile");
    if (profile) {
      try {
        const parsed = JSON.parse(profile);
        const firstName = parsed.first_name || "";
        const lastName = parsed.last_name || "";
        const full = `${firstName} ${lastName}`.trim();
        setFullName(full || "User");
      } catch (err) {
        console.error("Failed to parse patient profile:", err);
        setFullName("User");
      }
    } else {
      setFullName("User");
    }

    // Fetch doctors
    const fetchDoctors = async () => {
      try {
        const response = await fetch(
          "https://qa-uaesaas-api.instapract.ae/web/api/doctor/doc-list",
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
              APPID: "Gem3s12345",
              Authorization: `Bearer ${token}`,
            },
            body: JSON.stringify({}),
          }
        );

        const data = await response.json();
        console.log("Doctors List API Response:", data);

        if (response.ok && Array.isArray(data.data)) {
          setDoctors(data.data);
        } else {
          setDoctors([]);
        }
      } catch (error) {
        console.error("Error fetching doctor list:", error);
      }
    };

    if (token) {
      fetchDoctors();
    } else {
      console.warn("No token found in localStorage.");
    }
  }, [token]);

  const getProfilePic = (url) => {
    if (!url)
      return "https://cdn-icons-png.flaticon.com/512/387/387561.png";
    return url.startsWith("http")
      ? url
      : `https://qa-uaesaas-api.instapract.ae${url}`;
  };

  return (
    <div className="container">
      {/* Navbar-style top section */}
      <div className="top-bar">
        <div className="left-section">
          <img
            src={getProfilePic("")}
            alt="User"
            className="user-profile-pic"
          />
          <span className="user-name">Welcome, {fullName}</span>
        </div>

        <div className="right-section">
          <h2 className="doc-logo"><span>Insta</span>pract</h2>
          <h5 className="doc-subtitle">HealthTech IT Solution</h5>
        </div>
      </div>

      <h2 className="title">List of Available Doctors</h2>

      {doctors.length === 0 ? (
        <p className="no-data">No doctors found.</p>
      ) : (
        <div className="doctor-list">
          {doctors.map((doc, index) => (
            <div key={index} className="doctor-card">
              <div className="profile-section">
                <img
                  src={getProfilePic(doc.profile_pic)}
                  alt={doc.name}
                  className="profile-pic"
                />
                <div className="doctor-info">
                  <h3>{doc.name}</h3>
                  <p>{doc.specialty?.[0]?.name || "No Specialty"}</p>
                </div>
              </div>
              <button className="connect-button">Connect</button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default DoctorList;
